        if (g_dbus_interface_skeleton_get_connection(G_DBUS_INTERFACE_SKELETON(skeleton)) != NULL && info->emits_changed_signal)
            _bluez_adapter1_schedule_emit_changed(skeleton, info, prop_id, &skeleton->priv->properties[prop_id - 1]);
        g_value_copy(value, &skeleton->priv->properties[prop_id - 1]);
