/**
 * bluez_object_manager_client_new_for_bus_sync:
 * @bus_type: A #GBusType.
 * @flags: Flags from the #GDBusObjectManagerClientFlags enumeration.
 * @name: A bus name (well-known or unique).
 * @object_path: An object path.
 * @cancellable: (nullable): A #GCancellable or %NULL.
 * @error: Return location for error or %NULL
 *
 * Like bluez_object_manager_client_new_sync() but takes a #GBusType instead of a #GDBusConnection.
 *
 * The calling thread is blocked until a reply is received.
 *
 * See bluez_object_manager_client_new_for_bus() for the asynchronous version of this constructor.
 *
 * Returns: (transfer full) (type BluezObjectManagerClient): The constructed object manager client or %NULL if @error is set.
 */
GDBusObjectManager * bluez_object_manager_client_new_for_bus_sync(GBusType bus_type, GDBusObjectManagerClientFlags flags,
                                                                  const gchar * name, const gchar * object_path,
                                                                  GCancellable * cancellable, GError ** error)
{
    GInitable * ret;
    ret = g_initable_new(BLUEZ_TYPE_OBJECT_MANAGER_CLIENT, cancellable, error, "flags", flags, "name", name, "bus-type", bus_type,
                         "object-path", object_path, "get-proxy-type-func", bluez_object_manager_client_get_proxy_type, NULL);
    if (ret != NULL)
        return G_DBUS_OBJECT_MANAGER(ret);
    else
        return NULL;
}
